import "./public/style.css";


const Main = () => {
    const [players, setPlayers] = useState([]);

    useEffect(() => {
        const getPlayers = async () => {
            const players = await fetchAllPlayers();
        }
    }, []);

return (
    <div><PlayerForm players={players} setPlayers={setPlayers} /></div>
)
}

export default Main;
